contract MarketplaceStorage {
    enum ItemStatus {
        MINTED,
        LIST,
        BOUGHT,
        OFFER,
        DELIST
    }

    struct Item {
        // Item ID
        bytes32 id;
        // Owner of the NFT
        address seller;
        // NFT registry address
        address nftAddress;
        // Price (in wei) for the listing item
        uint256 price;
        // Price (in Anta) for the listing item
        uint256 priceAnta;
        // status of the item
        ItemStatus status;
    }

    struct ItemOffer {
        // Item ID
        bytes32 id;
        // Price (in wei) for the published item
        uint256 offerPrice;
    }
    bytes4 public constant ERC721_Interface = bytes4(0x80ac58cd);

    // From ERC721 registry assetId to Item (to avoid asset collision)
    mapping(address => mapping(uint256 => Item)) public items;

    // From ERC721 registry assetId to Offer (to avoid asset collision)
    mapping(address => mapping(uint256 => mapping(address => ItemOffer)))
        public itemOffers;
    IERC20 public sqfToken;

    uint8 public bnbFeePercent;
    uint8 public antaFeePercent;

    event Claim(address indexed receiver, uint256 value);

    event DelistItemSuccessful(
        address nftAddress,
        bytes32 id,
        uint256 indexed assetId,
        address indexed delistBy,
        uint256 createdAt
    );
    event BuyItemSuccessful(
        bytes32 id,
        uint256 indexed assetId,
        address indexed seller,
        address nftAddress,
        uint256 price,
        uint8 feePercent,
        uint256 fee,
        address indexed buyer,
        string currency,
        uint256 createdAt
    );
    event SellItemSuccessful(
        address nftAddress,
        bytes32 id,
        uint256 indexed assetId,
        uint256 price,
        address indexed seller,
        string currency,
        uint256 createdAt
    );
}

contract NFTMarket is ReentrancyGuard, MarketplaceStorage, Ownable {
  using Counters for Counters.Counter;
  Counters.Counter private _itemIds;
  Counters.Counter private _itemsSold;

  struct MarketItem {
    uint itemId;
    address nftContract;
    uint256 tokenId;
    address payable seller;
    address payable owner;
    uint256 price;
  }

  mapping(uint256 => MarketItem) private idToMarketItem;

  event MarketItemCreated (
    uint indexed itemId,
    address indexed nftContract,
    uint256 indexed tokenId,
    address seller,
    address owner,
    uint256 price
  );


  function getMarketItem(uint256 marketItemId) public view returns (MarketItem memory) {
    return idToMarketItem[marketItemId];
  }

function setSQFToken(address _address) external onlyOwner {
        sqfToken = IERC20(_address);
}

  function createMarketItem(
    address nftContract,
    uint256 tokenId,
    uint256 price
  ) public payable nonReentrant {
    require(price > 0, "Price must be at least 1 wei");

    _itemIds.increment();
    uint256 itemId = _itemIds.current();

    idToMarketItem[itemId] =  MarketItem(
      itemId,
      nftContract,
      tokenId,
      payable(msg.sender),
      payable(address(0)),
      price
    );

    IERC721(nftContract).transferFrom(msg.sender, address(this), tokenId);

    emit MarketItemCreated(
      itemId,
      nftContract,
      tokenId,
      msg.sender,
      address(0),
      price
    );
  }

  function sellItem(
        address nftAddress,
        uint256 assetId,
        uint256 price
    ) public {
        require(price > 0, "Price should be bigger than 0");
        _requireERC721(nftAddress);

        address seller = msg.sender;
        IERC721 nftRegistry = IERC721(nftAddress);

        require(
            nftRegistry.ownerOf(assetId) == seller,
            "The seller is no longer the owner"
        );
        nftRegistry.transferFrom(seller, address(this), assetId);
        Item memory item = items[nftAddress][assetId];
        if (item.id == 0) {
            _createItem(seller, assetId, nftAddress, price, 0);
        } else {
            require(item.status != ItemStatus.LIST, "Asset is listing");
            items[nftAddress][assetId].status = ItemStatus.LIST;
            items[nftAddress][assetId].price = price;
            items[nftAddress][assetId].seller = seller;
        }
        emit SellItemSuccessful(
            nftAddress,
            item.id,
            assetId,
            price,
            seller,
            "BNB",
            block.timestamp
        );
    }

  function createMarketSale(
    address nftContract,
    uint256 itemId
    ) public payable nonReentrant {
    uint price = idToMarketItem[itemId].price;
    uint tokenId = idToMarketItem[itemId].tokenId;
    require(msg.value == price, "Please submit the asking price in order to complete the purchase");

    idToMarketItem[itemId].seller.transfer(msg.value);
    IERC721(nftContract).transferFrom(address(this), msg.sender, tokenId);
    idToMarketItem[itemId].owner = payable(msg.sender);
    _itemsSold.increment();
  }

  function fetchMarketItem(uint itemId) public view returns (MarketItem memory) {
    MarketItem memory item = idToMarketItem[itemId];
    return item;
  }

  function fetchMarketItems() public view returns (MarketItem[] memory) {
    uint itemCount = _itemIds.current();
    uint unsoldItemCount = _itemIds.current() - _itemsSold.current();
    uint currentIndex = 0;

    MarketItem[] memory items = new MarketItem[](unsoldItemCount);
    for (uint i = 0; i < itemCount; i++) {
      if (idToMarketItem[i + 1].owner == address(0)) {
        uint currentId = idToMarketItem[i + 1].itemId;
        MarketItem storage currentItem = idToMarketItem[currentId];
        items[currentIndex] = currentItem;
        currentIndex += 1;
      }
    }

    return items;
  }

  function fetchMyNFTs() public view returns (MarketItem[] memory) {
    uint totalItemCount = _itemIds.current();
    uint itemCount = 0;
    uint currentIndex = 0;

    for (uint i = 0; i < totalItemCount; i++) {
      if (idToMarketItem[i + 1].owner == msg.sender) {
        itemCount += 1;
      }
    }

    MarketItem[] memory items = new MarketItem[](itemCount);
    for (uint i = 0; i < totalItemCount; i++) {
      if (idToMarketItem[i + 1].owner == msg.sender) {
        uint currentId = idToMarketItem[i + 1].itemId;
        MarketItem storage currentItem = idToMarketItem[currentId];
        items[currentIndex] = currentItem;
        currentIndex += 1;
      }
    }

    return items;
  }

   function buyItemBySQF(
        address nftAddress,
        uint256 assetId,
        uint256 priceAnta
    ) public {
        _requireERC721(nftAddress);

        address sender = msg.sender;
        IERC721 nftRegistry = IERC721(nftAddress);
        Item memory item = items[nftAddress][assetId];

        require(item.id != 0, "Asset not published");
        require(item.status == ItemStatus.LIST, "Asset is not list to buy");

        address seller = item.seller;

        require(seller != address(0), "Invalid address");
        require(priceAnta >= item.priceAnta, "price need equal listing price");

        uint256 fee = (antaFeePercent * priceAnta) / 100;
        uint256 remainAmount = priceAnta - fee;
        sqfToken.transferFrom(sender, address(this), fee);
        sqfToken.transferFrom(sender, seller, remainAmount);
        nftRegistry.safeTransferFrom(address(this), sender, assetId);

        items[nftAddress][assetId].seller = sender;
        items[nftAddress][assetId].status = ItemStatus.BOUGHT;

        emit BuyItemSuccessful(
            item.id,
            assetId,
            seller,
            nftAddress,
            item.priceAnta,
            antaFeePercent,
            fee,
            sender,
            "ANTA",
            block.timestamp
        );
    }

    function _requireERC721(address nftAddress) internal view {
        require(
            isContract(nftAddress),
            "The NFT Address should be a contract"
        );

        IERC721 nftRegistry = IERC721(nftAddress);
        require(
            nftRegistry.supportsInterface(ERC721_Interface),
            "The NFT contract has an invalid ERC721 implementation"
        );
    }

    function isContract(address _addr) private view returns (bool){
    uint32 size;
    assembly {
    size := extcodesize(_addr)
    }
    return (size > 0);
}
function _createItem(
        address seller,
        uint256 assetId,
        address nftAddress,
        uint256 price,
        uint256 priceAnta
    ) internal {
        bytes32 itemId = keccak256(
            abi.encodePacked(
                block.timestamp,
                seller,
                assetId,
                nftAddress,
                price
            )
        );

        items[nftAddress][assetId] = Item({
            id: itemId,
            seller: seller,
            nftAddress: nftAddress,
            price: price,
            priceAnta: priceAnta,
            status: ItemStatus.LIST
        });
    }
}

